(77, 'widget_text', 'a:5:{i:2;a:4:{s:5:\"title\";s:13:\"Come trovarci\";s:4:\"text\";s:164:\"<strong>Indirizzo</strong>\nvia Arnetina, 170 -  50136 FIRENZE (FI)\n\n<strong>Orari</strong>\nLunedì—Venerdì: 09:00–18:00\nSabato: 11:00–15:00 Domenica: chiuso\";s:6:\"filter\";b:1;s:6:\"visual\";b:1;}i:3;a:4:{s:5:\"title\";s:19:\"La nostra filosofia\";s:4:\"text\";s:112:\"Creazioni di gusto e bellezza che resistono al tempo ed esprimono armonia di valori, stati d’animo e passioni.\";s:6:\"filter\";b:1;s:6:\"visual\";b:1;}i:4;a:4:{s:5:\"title\";s:13:\"Come trovarci\";s:4:\"text\";s:158:\"<strong>Indirizzo</strong>\nvia Arnetina, 170\n50136 Firenze (FI)\n\n<strong>Orari</strong>\nLunedì—Venerdì: 09:00–19:00\nSabato: 09:00-15:00\nDomenica: chiuso\";s:6:\"filter\";b:1;s:6:\"visual\";b:1;}i:5;a:4:{s:5:\"title\";s:15:\"Noi siamo Domus\";s:4:\"text\";s:876:\"<div class=\"column mcb-column one column_column column-margin-\">\n<div class=\"column_attr clearfix align_center\">\n\n&nbsp;\n<div class=\"image_frame image_item no_link scale-with-grid alignnone no_border\">\n<div class=\"image_wrapper\"><img class=\"scale-with-grid lazyloaded\" src=\"https://www.wald.it/wp-content/uploads/2018/08/home_cafe_sep.png\" alt=\"\" data-src=\"https://www.wald.it/wp-content/uploads/2018/08/home_cafe_sep.png\" /></div>\n</div>\n</div>\n</div>\n<div class=\"column mcb-column one-sixth column_placeholder\">\n<div class=\"placeholder\"></div>\n</div>\n<div class=\"column mcb-column two-third column_column column-margin-\">\n<div class=\"column_attr clearfix align_center\">\n<p class=\"big\">DOMUS è il risultato di un mix di tradizione e ricerca di nuove tecniche di produzione e design per\ncreare, con uno stile originale, oggetti che vanno oltre le tendenze.</p>\n\n</div>\n</div>\";s:6:\"filter\";b:1;s:6:\"visual\";b:1;}s:12:\"_multiwidget\";i:1;}', 'yes'),
