(17, 1, '2023-10-05 19:35:21', '2023-10-05 19:35:21', '<!-- wp:paragraph -->\n<p>Benvenuto nel tuo sito! Questa è la tua pagina home, quella che la maggioranza dei visitatori vede quando arrivano per la prima volta sul tuo sito.</p>\n<!-- /wp:paragraph -->		\n			<style>/*! elementor - v3.16.0 - 20-09-2023 */\n.elementor-widget-image-box .elementor-image-box-content{width:100%}@media (min-width:768px){.elementor-widget-image-box.elementor-position-left .elementor-image-box-wrapper,.elementor-widget-image-box.elementor-position-right .elementor-image-box-wrapper{display:flex}.elementor-widget-image-box.elementor-position-right .elementor-image-box-wrapper{text-align:right;flex-direction:row-reverse}.elementor-widget-image-box.elementor-position-left .elementor-image-box-wrapper{text-align:left;flex-direction:row}.elementor-widget-image-box.elementor-position-top .elementor-image-box-img{margin:auto}.elementor-widget-image-box.elementor-vertical-align-top .elementor-image-box-wrapper{align-items:flex-start}.elementor-widget-image-box.elementor-vertical-align-middle .elementor-image-box-wrapper{align-items:center}.elementor-widget-image-box.elementor-vertical-align-bottom .elementor-image-box-wrapper{align-items:flex-end}}@media (max-width:767px){.elementor-widget-image-box .elementor-image-box-img{margin-left:auto!important;margin-right:auto!important;margin-bottom:15px}}.elementor-widget-image-box .elementor-image-box-img{display:inline-block}.elementor-widget-image-box .elementor-image-box-title a{color:inherit}.elementor-widget-image-box .elementor-image-box-wrapper{text-align:center}.elementor-widget-image-box .elementor-image-box-description{margin:0}</style><figure><img src=\"https://caliziamichela.netsons.org/wp-content/plugins/elementor/assets/images/placeholder.png\" title=\"\" alt=\"\" loading=\"lazy\" /></figure><h3>Questa è l&#039;intestazione</h3><p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Ut elit tellus, luctus nec ullamcorper mattis, pulvinar dapibus leo.</p>', 'Homepage', '', 'publish', 'closed', 'closed', '', 'homepage', '', '', '2023-10-09 00:20:40', '2023-10-09 00:20:40', '', 0, 'https://caliziamichela.netsons.org/?page_id=17', 0, 'page', '', 0),
(18, 1, '2023-10-05 19:35:21', '2023-10-05 19:35:21', '<!-- wp:paragraph -->\n<p>L\'azienda è animata da una tendenza cosmopolita, sempre attuale ed in continua evoluzione. Progetta, realizza ed interpreta con forme contemporanee oggetti e microarchitetture d’arredo che personalizzano la casa con un lusso discreto e misurato, capace di riflettere il lifestyle di chi la abita.</p>\n<!-- /wp:paragraph -->', 'Chi siamo', '', 'publish', 'closed', 'closed', '', 'chi-siamo', '', '', '2023-10-09 01:46:23', '2023-10-09 01:46:23', '', 0, 'https://caliziamichela.netsons.org/?page_id=18', 0, 'page', '', 0),
(19, 1, '2023-10-05 19:35:21', '2023-10-05 19:35:21', '<!-- wp:paragraph -->\n<p>Questa è una pagina con alcune informazioni di base per un contatto, quali un indirizzo ed un n numero di telefono. Puoi anche provare un plugin per aggiungere modulo di contatto.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:code -->\n<pre class=\"wp-block-code\"><code>https:&#47;&#47;maps.app.goo.gl/wEtVgm86QGWcTzGy8</code></pre>\n<!-- /wp:code -->', 'Contatti', '', 'trash', 'closed', 'closed', '', 'contatti__trashed', '', '', '2023-10-09 13:36:51', '2023-10-09 13:36:51', '', 0, 'https://caliziamichela.netsons.org/?page_id=19', 0, 'page', '', 0),
(20, 1, '2023-10-05 19:35:21', '2023-10-05 19:35:21', '<!-- wp:paragraph {\"align\":\"left\"} -->\n<p class=\"has-text-align-left\">Ispirato al vivere quotidiano e ai suoi ritmi veloci. L\'arredamento contemporaneo sceglie la semplicità e il comfort, con l\'attenzione al dettaglio più curato</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:group {\"align\":\"full\",\"layout\":{\"type\":\"constrained\"}} -->\n<div class=\"wp-block-group alignfull\"><!-- wp:cover {\"useFeaturedImage\":true,\"dimRatio\":50,\"overlayColor\":\"black\",\"focalPoint\":{\"x\":0.5,\"y\":0.5},\"minHeight\":50,\"contentPosition\":\"center center\",\"isDark\":false,\"align\":\"full\",\"style\":{\"spacing\":{\"padding\":{\"top\":\"var:preset|spacing|30\",\"right\":\"var:preset|spacing|30\",\"bottom\":\"var:preset|spacing|30\",\"left\":\"var:preset|spacing|30\"}}}} -->\n<div class=\"wp-block-cover alignfull is-light\" style=\"padding-top:var(--wp--preset--spacing--30);padding-right:var(--wp--preset--spacing--30);padding-bottom:var(--wp--preset--spacing--30);padding-left:var(--wp--preset--spacing--30);min-height:50px\"><span aria-hidden=\"true\" class=\"wp-block-cover__background has-black-background-color has-background-dim\"></span><div class=\"wp-block-cover__inner-container\"><!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><!-- wp:heading {\"textAlign\":\"center\",\"fontSize\":\"large\"} -->\n<h2 class=\"wp-block-heading has-text-align-center has-large-font-size\">Stile contemporaneo</h2>\n<!-- /wp:heading --></blockquote>\n<!-- /wp:quote --></div></div>\n<!-- /wp:cover --></div>\n<!-- /wp:group -->', 'Blog', '', 'publish', 'closed', 'closed', '', 'blog', '', '', '2023-10-09 11:45:48', '2023-10-09 11:45:48', '', 0, 'https://caliziamichela.netsons.org/?page_id=20', 0, 'page', '', 0),
