(59, 1, '2023-10-09 01:16:35', '2023-10-09 01:16:35', '<!-- wp:paragraph {\"align\":\"left\"} -->\n<p class=\"has-text-align-left\">Ispirato al vivere quotidiano e ai suoi ritmi veloci. L\'arredamento contemporaneo sceglie la semplicità e il comfort, con l\'attenzione al dettaglio più curato</p>\n<!-- /wp:paragraph -->', 'Blog', '', 'inherit', 'closed', 'closed', '', '20-revision-v1', '', '', '2023-10-09 01:16:35', '2023-10-09 01:16:35', '', 20, 'https://caliziamichela.netsons.org/?p=59', 0, 'revision', '', 0),
(61, 1, '2023-10-09 01:22:55', '2023-10-09 01:22:55', '<!-- wp:paragraph -->\n<p>L\'azienda è animata da una tendenza cosmopolita, sempre attuale ed in continua evoluzione. Interpreta con forme contemporanee oggetti e microarchitetture d’arredo che personalizzano la casa con un lusso discreto e misurato, capace di riflettere il lifestyle di chi la abita.</p>\n<!-- /wp:paragraph -->', 'Chi siamo', '', 'inherit', 'closed', 'closed', '', '18-revision-v1', '', '', '2023-10-09 01:22:55', '2023-10-09 01:22:55', '', 18, 'https://caliziamichela.netsons.org/?p=61', 0, 'revision', '', 0),
